import React from "react";
import styled from "styled-components";

const Section = styled.section`
  margin: 0 auto;
  max-width: 1260px;
  padding: 0 20px;
  width: 100%;
  @media (min-width: 620px) {
    max-width: 1600px;
    padding-left: 80px;
    padding-right: 80px;
    padding: 0 40px;
  }
  @media (min-width: 1020px) {
    max-width: 1684px;
    padding-left: 122px;
    padding-right: 122px;
  }
`;

const Magazine = styled.section`
  margin: 50px 0 20px;
  position: relative;
  text-align: center;
  @media (min-width: 620px) {
    margin: 230px 0 60px;
  }
`;
const Sections = () => <Section></Section>;

export default Sections;
